    <Accordion defaultActiveKey="0">
      <Card>
        <Card.Header style={{
                  background:
                    "linear-gradient(to bottom, #33ccff 0%, #3399ff 86%)",
                }}>

          <Accordion.Header>
            Panel 1
          </Accordion.Header>
        </Card.Header>

        <Accordion.Collapse eventKey="0">
          <Card.Body>Body content for panel 1</Card.Body>
        </Accordion.Collapse>
      </Card>

      <Card>
        <Card.Header style={{
                  background:
                    "linear-gradient(to bottom, #33ccff 0%, #3399ff 86%)",
                }}>
          <Accordion.Header>
            Panel 2
          </Accordion.Header>
        </Card.Header>

        <Accordion.Collapse eventKey="1">
          <Card.Body>Body content for panel 2</Card.Body>
        </Accordion.Collapse>
      </Card>
    </Accordion>
  );
}
export default Education;
